import React from 'react'
import Header from '../Components/Header'
import BookList from '../Components/BookList'
import BookFilter from '../Components/BookFilter'

import Stack from 'react-bootstrap/Stack';

const Home = () => {
  return (
    <Stack gap={3}>
      <Header />
      <BookFilter />
      <BookList />
    </Stack>
  );
};

export default Home
